import React, {Fragment, useState} from 'react';

const Formulario = () => {
    return (
        <div>
            <form className="form-group">
                <input className="form-control" type="text" />
                <input className="form-control" type="text" />
                <input className="form-control btn btn-success" type="submit" />
            </form>
        </div>
    )
}

export default Formulario;
